import React from 'react';
import { Link } from 'react-router-dom';

const HomePage = () => {
    return (
        <div className="main-wrapper">
            <div className="card">
                <h1>Welcome to the Custom Quiz Maker!</h1>
                <p>Create your own personalized quiz and share it with someone special.</p>
                <Link to="/create" className="interactive-button" style={{ textDecoration: 'none' }}>Create a New Quiz</Link>
            </div>
        </div>
    );
};

export default HomePage;
